function updateElementColor(elements, color) {
  const colorClasses = [
    'bg-gradient-primary',
    'bg-gradient-dark',
    'bg-gradient-info',
    'bg-gradient-success',
    'bg-gradient-warning',
    'bg-gradient-danger'
  ];

  elements.forEach(element => {
    colorClasses.forEach(cls => {
      if (element.classList.contains(cls)) {
        element.classList.remove(cls);
      }
    });
    element.classList.add(`bg-gradient-${color}`);
  });
}

